#@title Фнкция для создания дискриминатора
def create_discriminator():
	vec = Input(shape = data_shape) #вектор, сгенерированный генератором

	x = Flatten(input_shape = data_shape)(vec)
	x = BatchNormalization()(x)
	x = Dense(1024, activation = 'relu')(x)
	x = Dropout(0.2)(x)
	x = Dense(512, activation = 'relu')(x)
	x = Dropout(0.2)(x)
	x = Dense(256, activation = 'relu')(x)
	x = Dropout(0.2)(x)
	x = Dense(128, activation = 'relu')(x)
	x = Dropout(0.2)(x)
	x = Dense(64, activation = 'relu')(x)

	x = Dense(1, activation = 'sigmoid')(x)# дискриминатор должен вернуть да/нет на вектор, который в него входит, отсюда 1 нейрон и функция активации sigmoid

	discriminator = Model(vec, x)
	discriminator.compile(loss = 'binary_crossentropy', optimizer = 'adam', metrics = ['accuracy'])#функция ошибки binary_crossentropy т.к. классификация бинарная

	discriminator.trainable = False#дискриминатор заморожен по умолчанию, т.е. его веса не меняются

	return discriminator

#@title Состязательный алгоритм
def GAN_algorithm(generator, discriminator, epochs, batch_size):
  #метки для дискриминатора
	true_labels = np.ones((batch_size, 1))
	generated_labels = np.zeros((batch_size, 1))

  #создание GAN сети
	noise = Input(shape = (random_vec, ))
	generate_vec = generator(noise)
	disc_res = discriminator(generate_vec)

	GAN = Model(noise, disc_res)#в GAN генератор и дискриминатор входят как слои
	GAN.compile(loss = 'binary_crossentropy', optimizer = 'adam')

	d_loss_list = []
	g_loss_list = []
	d_accuracy_list = []

	for epoch in range(epochs):
		vecs = np.array(random.choices(x_train, k = batch_size))#получение случайных строк(векторов) из таблицы

		noise = np.random.normal(0, 1, (batch_size, random_vec))#создание случайных векторов для подачи а генератор

		gen_vecs = generator.predict(noise)# генерация строки генератором

		d_train_real = discriminator.train_on_batch(vecs, true_labels)# обучение дискриминатора на реальных данных
		d_train_gen = discriminator.train_on_batch(gen_vecs, generated_labels)# обучение дискриминатора на предсказанных данных

		d_loss = 0.5 * np.add(d_train_real, d_train_gen)# ошибка дискриминатора


		g_train = GAN.train_on_batch(noise, true_labels)#ошибка генератора


		d_loss_list.append(d_loss[0])
		g_loss_list.append(g_train)
		d_accuracy_list.append(100 * d_loss[1])#точность распознования дискиминатора


		print(gen_vecs)
		print ('%d [D loss: %f, acc.: %.2f%%] [G loss: %f]' % (epoch, d_loss[0], 100*d_loss[1], g_train))

		if epoch % 500 == 0:
			generator.save_weights("/content/not_trained_generator.h5")

	plt.plot(d_loss_list, label="Ошибка дискриминатора")
	plt.plot(g_loss_list, label="Ошибка генератора")
	plt.legend()
	plt.show()
	plt.plot(d_accuracy_list, label="Точность распознавания дискриминатора")
	plt.legend()
	plt.show()

