#@title Функция предсказания наград
def get_action(state, #предыдущее состояние агента
               epsilon,
               action_size):

  #генерируем случайное действие
  if random.random() <= epsilon:
      action_index = random.randint(0, action_size-1)

  else:
      Q_values = main_model.predict(np.expand_dims(state, axis = 0)) #предсказываем все значения Q
      action_index = np.argmax(Q_values)#извлекаем индекс действия, которое приводит к максимальному значению Q
  #снижаем эпсилон
  if epsilon > final_epsilon:
    epsilon -= epsilon_decay_factor

  return epsilon, action_index

#@title Функция получения наград
def get_reward(previous_info, #info --> profit, balance, cryptobalance
               current_info):

  reward = 0 #инициализируем награду

  if current_info[0] >= previous_info[0]:#в current_info[0]/previous_info[0] хранится информация о текущей и предыдущей прибыли
    reward += 500# награда увеличивается, если агент увеличил или не потерял прибыль
    if previous_info[0] < 0:
      reward -= 1000 #награда уменьшается, если предыдущая прибыль была меньше нуля
      if current_info[0] < 0:
        reward -= 1000#награда увеличивается, если предыдущая прибыль была меньше нуля
    if current_info[0] > previous_info[0]:
      reward += 700#за увеличение прибыли награда увеличивается

  else:
    reward -= 1000 #за любые другие действия награда сниджается


  return reward

#@title Функция добавления данных в память
def add_to_memory(previous_info, current_info, reward, action_index):
  memory.append((previous_info, current_info, reward, action_index)) #добавление в память массивов состояния агента, награды и действий

#@title Функция сэмплирования данных
def sample_from_memory():
  memory_batch_size = min(batch_size * timesteps_per_train, len(memory))#определение размера памяти
  mini_batch = random.sample(memory, memory_batch_size)#сэмплирование данных

  #массивы из нулей размерностью предыдущих и текущих состояний, действий, наград
  previous_infos = np.zeros((memory_batch_size, 3))
  current_infos = np.zeros((memory_batch_size, 3))
  actions = np.zeros((memory_batch_size))
  rewards = np.zeros((memory_batch_size))
  #копируем данные в массивы нулей
  for i in range(memory_batch_size):
    previous_infos[i, :] = mini_batch[i][0]
    current_infos[i, :] = mini_batch[i][1]
    rewards[i] = mini_batch[i][2]
    actions[i] = mini_batch[i][3]

  return previous_infos, current_infos, rewards, actions.astype(np.uint8)

#@title Функция обучения нейронной сети
def train_network():
  #извлечение данных из памяти
  previous_infos, current_infos, rewards, actions = sample_from_memory()
  #предсказание Q-значений
  Q_values = main_model.predict(previous_infos)
  #предсказание следующих Q-значений
  next_Q_values = target_model.predict(current_infos)
  #модификация Q-значений
  for i in range(len(current_infos)):

    Q_values[i, actions[i]] = rewards[i] + gamma * next_Q_values[i, actions[i]]

  main_model.fit(previous_infos, Q_values, batch_size = batch_size)#обучение модели

#@title Функция для создания дуэльной сети
#создание дуэльной сети
def make_network(input_shape, action_size, learning_rate):

  state_input = Input(shape=(input_shape))#входной слой
  x = Dense(512, activation='relu')(state_input)#линейный слой
  #предсказание значения V
  state_value = Dense(256, activation='relu')(x)  #скрытый линейный слой
  state_value = Dense(1)(state_value)#добавляем линейный слой с 1 нейроном для подсчёта скалярного значения V
  state_value = Lambda(lambda s: K.expand_dims(s[:, 0], axis=-1), output_shape=(action_size,))(state_value)#добавление размерности для суммирования с веткой преимущества
  #Следующая ветка предсказывает значения преимущества A для каждого возможного действия
  action_advantage = Dense(256, activation='relu')(x)
  action_advantage = Dense(action_size)(action_advantage)
  action_advantage = Lambda(lambda a: a[:, :] - K.mean(a[:, :], keepdims=True), output_shape=(action_size,))(action_advantage)#вычисляет среднее значение, таким образом все преимущества, которые ниже среднего становятся отрицательными, а те что выше - положительными
  state_action_value = Add()([state_value, action_advantage])#суммирование преимущества и значения состояний для получения Q-значений для каждого возможного действия

  model = Model(state_input, state_action_value)
  model.compile(loss = 'mse', optimizer = Adam(learning_rate = learning_rate))


  return model

#@title Функция обновления весов целевой модели
#функция обновления весов целевой модели
def update_target_model():
  target_model.set_weights(main_model.get_weights())
  main_model.save_weights("/content/not_trained_target_crypto_model.h5")

#@title Функция для создания генератора
def create_generator():
  noise = Input(shape = (random_vec, ))


  x = Dense(1024, activation = 'relu')(noise)
  x = Dense(512, activation = 'relu')(x)
  x = BatchNormalization()(x)
  x = Dense(2048, activation = 'relu')(x)
  x = BatchNormalization()(x)
  x = Dense(256, activation = 'relu')(x)
  x = Dense(128, activation = 'relu')(x)
  x = BatchNormalization()(x)

  x = Dense(4, activation = 'tanh')(x)

  x = Reshape(data_shape)(x)


  generator = Model(noise, x)

  return generator

