def get_action_predict(state,
               epsilon,
               action_size):

  Q_values = target_model.predict(np.expand_dims(state, axis = 0))
  action_index = np.argmax(Q_values)

  if epsilon > final_epsilon:
    epsilon -= epsilon_decay_factor

  return epsilon, action_index

