#@title Функция show_results - функция для отображения результатов
def show_results(n, profit, rows_per_day):
  day = 0
  for i in range(n[-1]):
    if i % rows_per_day == 0:
      day += 1
      profit_per_day = sum(profit[i - rows_per_day:i:1])
      print(f'Profit per {day} day: ', profit_per_day)
  plt.plot(n, profit)
  plt.xlabel('Time', fontsize=16)
  plt.ylabel('Profit', fontsize=16)

